import react from 'react';
import  ReactDOM  from 'react-dom';
const name='prashant';
const state="maharashtra";
ReactDOM.render(
  <react.Fragment>[
  <h1>Hello {name}</h1>,
  <h1>{`I am from ${state}`} </h1>]
  </react.Fragment>
  ,
  document.getElementById("root")
);
